import React from 'react';
import P1 from "./pages/p1";
import P2 from "./pages/p2";
import P3 from "./pages/p3";


class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      myChildrens: []
      , historyPage: ""
      , pageKeyOnline: ""
      , pagesComponents: []
    }
  }
  componentWillMount() {

    const list_pagesComponents = [];
    list_pagesComponents["p1"] = P1;
    P1.constructor({myParent:this});
    list_pagesComponents["p2"] = P2;
    P2.constructor({myParent:this});
    list_pagesComponents["p3"] = P3;
    P3.constructor({myParent:this});

    this.setState({
      pageKeyOnline: "p1"
      ,pagesComponents:list_pagesComponents
    })

  }


  render() {
    return (
    this.state.pagesComponents[this.state.pageKeyOnline].prototype.render()
    );
  }
}

export default App;
